// Traverse a single tree
inline double traverseTree(const TreeNode* tree, int tree_size, const double* x) {
    int node = 0;
    while (node >= 0 && node < tree_size) {
        const TreeNode& n = tree[node];
        if (n.feature < 0) {
            return n.value;  // Leaf node
        }
        if (x[n.feature] < n.threshold) {
            node = n.left;
        } else {
            node = n.right;
        }
    }
    return 0.0;
}

// Main prediction function
// Input: full feature vector (217 RDKit + 22 cascade + 832 golden = 1071 features)
inline double predict(const double* full_features) {
    // Select features using FEATURE_IDX
    double x[N_SELECTED_FEATURES];
    for (int i = 0; i < N_SELECTED_FEATURES; ++i) {
        x[i] = full_features[FEATURE_IDX[i]];
    }
    
    // Sum predictions from all trees
    double sum = BASE_SCORE;
    for (int t = 0; t < N_TREES; ++t) {
        sum += traverseTree(TREES[t], TREE_SIZES[t], x);
    }
    return sum;
}

